    false,nt"url": null,nt"notes": "To establish baseline data and to monitor
    change over time to the Back Bay National Wildlife Refuge's(BBNWR) anuran populations
    the U.S. Fish and Wildlife Service, Region 5 (FWS) is currently conductingfrog and
    toad (anuran) calling surveys. The program is using standardized protocols. These
    protocols aresimilar those of the North American Amphibian Monitoring Program (NAAMP)
    which has establishedprotocols for all of North America. Surveys will provide a
    data set that will allow BBNWR to detectchanges to anuran (frog and toad) populations.
    The Wildlife Diversity Division (WDD) of the Virginia Department of Game and Inland
    Fisheries (DGIF), under agreement with the BBNWR, conducted anuran calling surveys
    during the 2000 calling season. Using protocols established by the FWS, a route
    consisting of 13 stops was laid out encompassing the BBNWR impoundments, located
    south of the town of Sandbridge in the City of Virginia Beach.",nt"owner_org":
